script: |
  super -f text -I q405.spq | sort > q405.out

inputs:
  - name: q405.spq
    data: |
      SELECT DISTINCT + col2 FROM tab1 (FORMAT parquet) WHERE NOT col0 / + col2 IN ( + col2 + - col1, col2, - col0 - + - col1 + - 5 );
  - name: tab1

outputs:
  - name: q405.out
    data: |
      59
      68
      96
